import { Flex, Card, Grid, Text, Heading, Paragraph } from '@contentful/f36-components';
import tokens from '@contentful/f36-tokens';
import { css } from 'emotion';
import React from 'react';
import VariationItem from './VariationItem';

const styles = {
   heading: css({
      marginBottom: '10px'
   }),
   container: css({
    width: '100%'
   })
}

function Variations(props) {
  return (
    <React.Fragment>
      <Heading element='h2' className={styles.heading}>Variations:</Heading>
      <Paragraph>Content created in this feature flag is available only for this feature flag</Paragraph>
      <Flex flexDirection='column' justifyContent='center' marginLeft='spacingS' marginTop='spacingL' className={styles.container}>
          <Grid rowGap="spacingM" columnGap='spacingM'>
              {props.variations.map(variation => {
              return <Grid.Item>
                  <VariationItem variation={variation}/>
              </Grid.Item>
              })}
          </Grid>
      </Flex>
    </React.Fragment>
  )
}

export default Variations;
